      const fragmentShaderSource = `#version 300 es
      precision mediump float;

      in vec2 vTexCoord;
      uniform sampler2D uSampler;
      out vec4 fragColor;

      void main() {
        fragColor = texture(uSampler, vTexCoord);
      }`

    const program = gl.createProgram()

    // VERTEX SHADER SETUP
    const vertexShader = gl.createShader(gl.VERTEX_SHADER)
    gl.shaderSource(vertexShader, vertexShaderSource)
    gl.compileShader(vertexShader)
    gl.attachShader(program, vertexShader)

    // FRAGMENT SHADER SETUP
    const fragmentShader = gl.createShader(gl.FRAGMENT_SHADER)
    gl.shaderSource(fragmentShader, fragmentShaderSource)
    gl.compileShader(fragmentShader)
    gl.attachShader(program, fragmentShader)

    gl.linkProgram(program)
    gl.useProgram(program)

    // VERTEX POSITION
    const vertexBuffer = gl.createBuffer()
    gl.bindBuffer(gl.ARRAY_BUFFER, vertexBuffer)
    gl.bufferData(gl.ARRAY_BUFFER, new Float32Array([
      -1.0,  1.0, // Top Left
       1.0,  1.0, // Top Right
      -1.0, -1.0, // Bottom Left
      -1.0, -1.0, // Bottom Left
       1.0,  1.0, // Top Right
       1.0, -1.0  // Bottom Right
    ]), gl.STATIC_DRAW)
    gl.vertexAttribPointer(0, 2, gl.FLOAT, false, 0, 0)
    gl.enableVertexAttribArray(0)

    // TEXTURE COORDINATE BUFFER
    const texCoordBuffer = gl.createBuffer()
    gl.bindBuffer(gl.ARRAY_BUFFER, texCoordBuffer)
    gl.bufferData(gl.ARRAY_BUFFER, new Float32Array([
      0.0, 0.0, // Top Left
      1.0, 0.0, // Top Right
      0.0, 1.0, // Bottom Left
      0.0, 1.0, // Bottom Left
      1.0, 0.0, // Top Right
      1.0, 1.0  // Bottom Right
    ]), gl.STATIC_DRAW)
    gl.vertexAttribPointer(1, 2, gl.FLOAT, false, 0, 0)
    gl.enableVertexAttribArray(1)

    // gl.pixelStorei(gl.UNPACK_FLIP_Y_WEBGL, true)
    const texture = gl.createTexture()
    gl.bindTexture(gl.TEXTURE_2D, texture)
    // webgl2 end
    
    const animate = (currentTime) => {
      const deltaTime = currentTime - lastTime

      if (deltaTime >= frameTime) {
        lastTime = currentTime
        pointerData[0] = pointerMap.get('x')
        pointerData[1] = pointerMap.get('y')
        instance.exports.game_loop()

        if (cpuCanvas.classList.contains('active')) {
          ctx.putImageData(imageData, 0, 0)
        } else {
          gl.texImage2D(gl.TEXTURE_2D, 0, gl.RGBA, 160, 160, 0, gl.RGBA, gl.UNSIGNED_BYTE, imageData)
          gl.texParameteri(gl.TEXTURE_2D, gl.TEXTURE_MIN_FILTER, gl.NEAREST)
          gl.texParameteri(gl.TEXTURE_2D, gl.TEXTURE_MAG_FILTER, gl.NEAREST)
          gl.drawArrays(gl.TRIANGLES, 0, 6)
        }
      }

      requestAnimationFrame(animate)
    }

    const changeFps = (e) => {
      e.preventDefault()
      if (currentFpsMode >= fpsModes.length - 1) {
        currentFpsMode = 0
      } else {
        currentFpsMode++ 
      }
      fpsButton.innerText = fpsModes[currentFpsMode].name
      frameTime = fpsModes[currentFpsMode].fps
    }

    const toggleCpuGpu = (e) => {
      e.preventDefault()
      if (cpuCanvas.classList.contains('active')) {
        cpuCanvas.classList.remove('active')
        gpuCanvas.classList.add('active')
        cpuGpuButton.innerText = 'GPU MODE'
      } else {
        gpuCanvas.classList.remove('active')
        cpuCanvas.classList.add('active')
        cpuGpuButton.innerText = 'CPU MODE'
      }
    }

    const setPointer = (e) => {
      e.preventDefault()
      let rect = null;
      
      if (cpuCanvas.classList.contains('active')) {
        rect = cpuCanvas.getBoundingClientRect()
      } else {
        rect = gpuCanvas.getBoundingClientRect()
      }

      const width = rect.width
      const height = rect.height

      if(e.type === 'pointerdown' && e.pointerType === 'mouse') {
        activeMousePointer = true
      }

      if (activeMousePointer || e.pointerType === 'touch') {
        pointerMap.set('x', Math.floor(e.offsetX / width * 160))
        pointerMap.set('y', Math.floor(e.offsetY / width * 160))
      }
    }

    const unsetPointer = (e) => {
      e.preventDefault()
      activeMousePointer = false
      pointerMap.set('x', 255)
      pointerMap.set('y', 255)
    }

    fpsButton.addEventListener('pointerdown', changeFps)
    cpuGpuButton.addEventListener('pointerdown', toggleCpuGpu)
    cpuCanvas.addEventListener('contextmenu', (e) => e.preventDefault())
    cpuCanvas.addEventListener('pointerdown', setPointer)
    cpuCanvas.addEventListener('pointermove', setPointer)
    cpuCanvas.addEventListener('pointerup', unsetPointer)
    cpuCanvas.addEventListener('pointercancel', unsetPointer)
    cpuCanvas.addEventListener('pointerout', unsetPointer)
    gpuCanvas.addEventListener('contextmenu', (e) => e.preventDefault())
    gpuCanvas.addEventListener('pointerdown', setPointer)
    gpuCanvas.addEventListener('pointermove', setPointer)
    gpuCanvas.addEventListener('pointerup', unsetPointer)
    gpuCanvas.addEventListener('pointercancel', unsetPointer)
    gpuCanvas.addEventListener('pointerout', unsetPointer)
    pointerMap.set('x', 255)
    pointerMap.set('y', 255)
    requestAnimationFrame(animate)
  </script>
</body>

</html>
